const scriptLines = [
  {row: 2, speaker: 'Victor', fileName: 'EP01_Victor_ColdOpen_01.wav', text: 'January 15th, 1981. A Tuesday. Louisville, Kentucky. Three people sitting in a living room. One of them, a woman named Carla Rueckert, just left her body. And something else, someone else, started speaking through her.'},
  {row: 3, speaker: 'Lenny', fileName: 'EP01_Lenny_ColdOpen_02.wav', text: 'For the next three years, this would happen 105 more times. The voice called itself Ra. It claimed to be a social memory complex from the sixth density. And it said it had a message to correct, one it botched 11,000 years ago in Egypt.'},
  {row: 4, speaker: 'Victor', fileName: 'EP01_Victor_ColdOpen_03.wav', text: 'This is that story. And the wild part? A lot of what Ra said in 1981, we are only now starting to prove.'},
  {row: 7, speaker: 'Victor', fileName: 'EP01_Victor_Intro_01.wav', text: 'Welcome to Distortion Check: The Ra Material. I am Victor Emil.'},
  {row: 8, speaker: 'Lenny', fileName: 'EP01_Lenny_Intro_02.wav', text: 'And I am Lenny Peppidge. And if you have never heard of the Ra Material, buckle up. If you have heard of it, we are about to poke at it in ways that might make you uncomfortable. And that is the point.'},
  {row: 9, speaker: 'Victor', fileName: 'EP01_Victor_Intro_03.wav', text: 'Yeah, we are not here to worship at the altar of Ra. We are also not here to dismiss it as New Age nonsense. We are here to examine it. Critically. With curiosity. And maybe a little bit of that Brooklyn-Boston tension that keeps things honest.'},
  {row: 10, speaker: 'Lenny', fileName: 'EP01_Lenny_Intro_04.wav', text: 'Victor is from South Brooklyn. I grew up near MIT in Boston. We both love consciousness research, quantum weirdness, and calling out BS when we see it. But we also know that some of the most profound truths sound absolutely insane until they do not.'},
  {row: 11, speaker: 'Victor', fileName: 'EP01_Victor_Intro_05.wav', text: 'Right. And the Ra Material? It sounded insane in 1981. But here is the thing, a lot of what Ra talked about back then? Consciousness as fundamental to reality. The observer effect in quantum mechanics. The interconnectedness of all things. Non-locality. Time as an illusion.'},
  {row: 12, speaker: 'Lenny', fileName: 'EP01_Lenny_Intro_06.wav', text: 'That stuff was not mainstream in 81. Now? It is showing up in peer-reviewed journals. So either Ra was a really good guesser, or something else was going on.'},
  {row: 13, speaker: 'Victor', fileName: 'EP01_Victor_Intro_07.wav', text: 'Over the next however-many episodes this takes, because there are 106 sessions, we are going to walk through this material. Session by session. We are going to challenge it. Question it. See where it holds up and where it falls apart.'},
  {row: 14, speaker: 'Lenny', fileName: 'EP01_Lenny_Intro_08.wav', text: 'And we are going to do it with respect for the three people who risked everything to bring this through. Because whatever you believe about channeling, about Ra, about any of this, Don Elkins, Carla Rueckert, and Jim McCarty were serious people doing serious work.'},
  {row: 15, speaker: 'Victor', fileName: 'EP01_Victor_Intro_09.wav', text: 'So. Let us start at the beginning. Who were these three people? How did they end up in a living room in Louisville, talking to an alleged extraterrestrial intelligence? And what happened on January 15th, 1981, that changed everything?'},
  {row: 16, speaker: 'Lenny', fileName: 'EP01_Lenny_Intro_10.wav', text: 'Let us boil it down.'},
  {row: 17, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_01.wav', text: 'Alright. Don Elkins. Physics professor. Airline pilot. UFO researcher. This guy was not some fringe weirdo. He taught at the University of Louisville. He flew commercial jets. And he was obsessed, obsessed, with one question: Are we alone?'},
  {row: 18, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_02.wav', text: 'And not in a little green men way. Don wanted to understand consciousness. He wanted to know if there were intelligences out there more advanced than us, and if so, what they knew that we did not.'},
  {row: 19, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_03.wav', text: 'In 1962, almost 20 years before the Ra contact, Don started experimenting with channeling. And I know, I know, channeling sounds like s√©ance-table nonsense. But here is the thing: Don approached it like a scientist. He was not trying to talk to dead relatives. He was trying to establish contact with non-human intelligence.'},
  {row: 20, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_04.wav', text: 'And he was meticulous. He recorded everything. He tested protocols. He refined the process. For years. And most of what came through? Introductory stuff. Basic metaphysical concepts. Nothing groundbreaking.'},
  {row: 21, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_05.wav', text: 'Enter Carla Rueckert. Carla met Don in 1962 at one of his channeling experiments. She was a librarian. Deeply spiritual. Kind of ethereal, from what I have read. And she had a gift for this work.'},
  {row: 22, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_06.wav', text: 'Don recognized it immediately. In 1974, twelve years after they met, he asked Carla to become the primary channel for their research group, which they called L/L Research.'},
  {row: 23, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_07.wav', text: 'And this is where it gets interesting. Up until this point, all of Carla channeling was conscious. Meaning she was aware of what was coming through her. She could hear it, remember it, even question it in real time.'},
  {row: 24, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_08.wav', text: 'But the quality of the material jumped once Carla took over. She refined Don protocols. She developed what they called tuning the instrument, basically getting into a meditative state that made the channel clearer, more stable.'},
  {row: 25, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_09.wav', text: 'Now. Third member of the trio: Jim McCarty. Jim was living off the grid in rural Kentucky in 1978. Built his own log cabin. 132 acres. No electricity. Just him, the woods, and a battery-powered radio.'},
  {row: 26, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_10.wav', text: 'One night, he is listening to this radio station out of Lexington, and he hears an interview with Don and Carla talking about UFOs. And something about it just clicked for him. He thought, I need to meet these people.'},
  {row: 27, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_11.wav', text: 'A year later, he does. Mutual friends introduce them. Jim starts driving to Louisville every Sunday night, an hour each way, to attend their channeling meditations. He does this for a year.'},
  {row: 28, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_12.wav', text: 'And then, in December 1980, Don and Carla invite him to move in and help with the research full-time. Jim arrives on December 23rd, 1980.'},
  {row: 29, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_13.wav', text: 'Twenty-three days later, everything changes.'},
  {row: 31, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_14.wav', text: 'January 15th, 1981. Carla is teaching a student how to channel. It is a normal session. Conscious channeling, like she had done hundreds of times before.'},
  {row: 33, speaker: 'Victor', fileName: 'EP01_Victor_ActOne_15.wav', text: 'And then a voice comes through her and says, I am Ra.'},
  {row: 34, speaker: 'Lenny', fileName: 'EP01_Lenny_ActOne_16.wav', text: 'And Carla leaves. Not the room. Her body. She goes completely unconscious. And this voice, Ra, starts speaking through her in a way that is mechanically operating her vocal cords.'}
];

console.log(`üìö Total script lines available: ${scriptLines.length}`);

// Apply rate limiting
const endIndex = Math.min(startIndex + maxItems, scriptLines.length);
const selectedLines = scriptLines.slice(startIndex, endIndex);

console.log(`üìä Selected ${selectedLines.length} lines (${startIndex + 1} to ${endIndex}) for processing`);

if (selectedLines.length === 0) {
  console.warn('‚ö†Ô∏è No lines selected! Check your startIndex value.');
  return [];
}

if (endIndex < scriptLines.length) {
  console.log(`‚ÑπÔ∏è To process the next batch, set startIndex to ${endIndex}`);
  console.log(`üìã Remaining lines: ${scriptLines.length - endIndex}`);
} else {
  console.log('‚úÖ This is the final batch - all lines will be processed');
}

// Create individual items for processing with rate limiting control
return selectedLines.map((line, index) => ({
  json: {
    ...line,
    voiceId: line.speaker === 'Victor' ? victorVoiceId : lennyVoiceId,
    cloudinaryFolder: cloudinaryFolder,
    cloudName: cloudName,
    itemIndex: index + 1,
    totalItems: selectedLines.length,
    batchStartIndex: startIndex,
    globalIndex: startIndex + index + 1,
    totalScriptLines: scriptLines.length,
    publicId: `${cloudinaryFolder}/${line.fileName.replace('.wav', '')}`
  }
}));

const current = $input.item.json;
console.log(`üé§ Processing ${current.globalIndex}/${current.totalScriptLines}: ${current.fileName} (${current.speaker})`);
console.log(`üì¶ Batch progress: ${current.itemIndex}/${current.totalItems}`);
return $input.all();

// Prepare the file for Cloudinary upload
const current = $input.item.json;

console.log(`üéµ Audio generated successfully for: ${current.fileName}`);
console.log('‚òÅÔ∏è Preparing for Cloudinary upload...');
console.log('üÜî Cloudinary public ID:', current.publicId);

return [{
  json: {
    ...current,
    uploadReady: true
  },
  binary: {
    data: $input.item.binary.data
  }
}];

const current = $input.item.json;
const uploadResult = current;
const publicId = uploadResult.public_id;
const secureUrl = uploadResult.secure_url;
const bytes = uploadResult.bytes || 0;
const format = uploadResult.format || 'wav';

console.log(`‚úÖ Successfully uploaded: ${current.fileName}`);
console.log(`üìä Batch progress: ${current.itemIndex}/${current.totalItems} (Global: ${current.globalIndex}/${current.totalScriptLines})`);
console.log(`üÜî Cloudinary public ID: ${publicId}`);
console.log(`üîó Secure URL: ${secureUrl}`);
console.log(`üìä File size: ${Math.round(bytes / 1024)} KB`);

// Check if this is the last item in current batch
if (current.itemIndex === current.totalItems) {
  console.log('');
  console.log(`üéâ BATCH COMPLETED! Processed ${current.totalItems} files successfully`);
  console.log(`üìä Global progress: ${current.globalIndex}/${current.totalScriptLines} total script lines`);

  if (current.globalIndex < current.totalScriptLines) {
    const remaining = current.totalScriptLines - current.globalIndex;
    console.log(`üìã Remaining lines: ${remaining}`);
    console.log(`üîÑ To process the next batch, set startIndex to ${current.globalIndex} in the configuration`);
  } else {
    console.log('üéä ALL SCRIPT LINES COMPLETED! The entire episode has been processed.');
  }

  console.log('‚òÅÔ∏è All files in this batch are safely stored in Cloudinary');
}

return $input.all();

const current = $input.item.json;
const error = current.error || {};
const statusCode = error.httpCode || 'unknown';
const message = error.message || 'Unknown error occurred';

console.error(`‚ùå Failed to generate audio: ${current.fileName}`);
console.error(`üìä Batch progress: ${current.itemIndex}/${current.totalItems} (Global: ${current.globalIndex}/${current.totalScriptLines})`);
console.error('Status Code:', statusCode);
console.error('Error Message:', message);

// Common error explanations
if (statusCode === 401) {
  console.error('üîë Credential issue - check your ElevenLabs API credential in N8N');
} else if (statusCode === 429) {
  console.error('‚è±Ô∏è Rate limit exceeded - consider increasing wait time between requests');
} else if (statusCode === 422) {
  console.error('üé§ Voice ID may be invalid or text content has issues');
} else if (statusCode === 403) {
  console.error('üö´ Forbidden - check your ElevenLabs account status');
}

// Continue processing other items
return [{
  json: {
    fileName: current.fileName,
    speaker: current.speaker,
    error: message,
    statusCode: statusCode,
    itemIndex: current.itemIndex,
    totalItems: current.totalItems,
    globalIndex: current.globalIndex,
    totalScriptLines: current.totalScriptLines,
    stage: 'audio_generation'
  }
}];

const current = $input.item.json;
const error = current.error || {};
const statusCode = error.httpCode || 'unknown';
const message = error.message || 'Cloudinary upload failed';

console.error(`‚ùå Failed to upload to Cloudinary: ${current.fileName}`);
console.error(`üìä Batch progress: ${current.itemIndex}/${current.totalItems} (Global: ${current.globalIndex}/${current.totalScriptLines})`);
console.error('Status Code:', statusCode);
console.error('Error Message:', message);

// Common Cloudinary error explanations
if (statusCode === 401 || statusCode === 400) {
  console.error('üîë Upload preset or authentication issue:');
  console.error('   - Check that "n8n_unsigned" upload preset exists in your Cloudinary account');
  console.error('   - Verify the preset is set to "Unsigned"');
  console.error('   - Ensure your cloud name is correct');
} else if (statusCode === 420) {
  console.error('üìä Rate limit or quota exceeded');
} else if (statusCode === 500) {
  console.error('üîß Cloudinary server error - try again later');
}

console.error('üí° Troubleshooting tips:');
console.error('   1. Check your Cloudinary upload preset configuration');
console.error('   2. Verify your Cloudinary account has sufficient quota');
console.error('   3. Ensure the cloud name is correct in Set Configuration node');

// Continue processing other items
return [{ 
  json: { 
    fileName: current.fileName,
    speaker: current.speaker,
    error: message,
    statusCode: statusCode,
    itemIndex: current.itemIndex,
    totalItems: current.totalItems,
    globalIndex: current.globalIndex,
    totalScriptLines: current.totalScriptLines,
    stage: 'cloudinary_upload'
  }
}];
